@js:
result = "<video src=\"" + result + "\" width=\"100%\" height=\"100%\" controls=\"controls\" ></video>";
result = "<html><head><meta charset=\"utf-8\"><meta name=\"viewport\" content=\"width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1,user-scalable=no\" /><style>html,body{margin:0;padding:0;width:100%;}</style></head><body>" + result + "</body></html>";
result

#gallery-2@img@src
<js>result.split('\n').map($=>`<li><img src="https://yskhd.com/wp-content/themes/modown/static/img/thumbnail.png" data-src="${$.replace('-285x285','')}"></li>`).join('\n')</js>
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=0">


<ul id="box">
{{result}}
</ul>


<link rel="stylesheet" href="https://cdn.bootcdn.net/ajax/libs/viewerjs/1.10.1/viewer.min.css">
<script src="https://cdn.bootcdn.net/ajax/libs/viewerjs/1.10.1/viewer.min.js"></script>
<script>
	root = document.getElementById('box')
	lazy = new IntersectionObserver(entires => {
		entires.forEach(item => {
			if(item.isIntersecting){
				item=item.target
				item.src=item.getAttribute('data-src')
				lazy.unobserve(item)
			}
		})
	}, {
		root: root,
		threshold: [0],
		rootMargin:"0px"
	})

imgs = document.getElementsByTagName('img')
Array.from(imgs).forEach(item => {
		lazy.observe(item)
	})

//查看大图插件
new Viewer(root,{title:false,interval:3000})
</script>

